//remove all districts first and replace them
//District.all().destroyAll(function() {
//var tempDistrict = new District();
window.deleteDistrict = {current:0,max:0};
District.all().count(function(count) {
	window.deleteDistrict.max = count;
	if (count == 0) {
		addNewDistricts();
	}
	else{
		District.all().list(function(districts) {
			districts.forEach(function(district) {
				window.deleteDistrict.current +=1;
				persistence.remove(district);
				persistence.flush();
				if (window.deleteDistrict.current == window.deleteDistrict.max) {
					addNewDistricts();
				}
			});
		});
	}
});

function addNewDistricts() {
	//add new districts
	for (f in districts.features) {
		var tempDistrict = new District();
		tempDistrict.name = districts.features[f].properties.NAME_1
		tempDistrict.boundary = escape(JSON.stringify(districts.features[f].geometry.coordinates));
		persistence.add(tempDistrict);
		persistence.flush;
	}
}
